import React, { useState } from 'react';
import {
  StyleSheet,
  Text,
  View,
  TextInput,
  TouchableOpacity,
} from 'react-native';

export default function Home({ route, navigation }) {
  let user = (route.params.nome);
  return (
    <View style={estilo.container}>
      <TouchableOpacity style={estilo.botao} onPress={() => navigation.navigate('Produto')}>
        <Text style={estilo.texto}>{user}</Text>
      </TouchableOpacity>
    </View>
  );
}

const estilo = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
  },
  input: {
    width: '90%',
    height: 50,
    fontSize: 18,
    backgroundColor: '#eee',
    marginTop: 10,
    borderRadius: 10,
    border: ['3px', 'solid'],
    padding: 10,
  },
  texto: {
    fontSize: 20,
    color: '#000',
  },
  botao: {
    justifyContent: 'center',
    alignItems: 'center',
    margin: 5,
    backgroundColor: '#41aef4',
    padding: 5,
  },
});
